import './app.css';
import Header from './components/Header/header.js';
import Nav from './components/nav';
import Producto from './components/productos';
import Footer from './components/footer';

function App() {
  return (
      <div className='App'>
        <div className='header'>
          <Header/>
        </div>
        <div>
          <Nav/>
        </div>
        <div>
          <Producto/>
        </div>
        <div></div>
      </div> 
  );
}


export default App;
